import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { Home, Image as ImageIcon, BookOpen, LogOut, LogIn, UserPlus, Search } from 'lucide-react';

import { Menu, X } from 'lucide-react';

const FloatingMenu = () => {
  const { isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();
  const [open, setOpen] = React.useState(false);

  const handleLogout = () => {
    logout();
    navigate('/login');
    setOpen(false);
  };

  // Menu content for reuse
  const menuContent = (
    <>
      {isAuthenticated ? (
        <>
          <Link to="/" className="group flex flex-col items-center space-y-1" onClick={() => setOpen(false)}>
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-indigo-500/20 transition-colors duration-200">
              <Home className="w-6 h-6 text-slate-300 group-hover:text-indigo-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-indigo-400 whitespace-nowrap">Home</span>
          </Link>
          <Link to="/photos" className="group flex flex-col items-center space-y-1" onClick={() => setOpen(false)}>
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-purple-500/20 transition-colors duration-200">
              <ImageIcon className="w-6 h-6 text-slate-300 group-hover:text-purple-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-purple-400 whitespace-nowrap">Photos</span>
          </Link>
          <Link to="/aisearch" className="group flex flex-col items-center space-y-1" onClick={() => setOpen(false)}>
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-blue-500/20 transition-colors duration-200">
              <Search className="w-6 h-6 text-slate-300 group-hover:text-blue-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-blue-400 whitespace-nowrap">AI</span>
          </Link>
          <Link to="/publish" className="group flex flex-col items-center space-y-1" onClick={() => setOpen(false)}>
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-pink-500/20 transition-colors duration-200">
              <BookOpen className="w-6 h-6 text-slate-300 group-hover:text-pink-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-pink-400 whitespace-nowrap">Publish</span>
          </Link>
          <button onClick={handleLogout} className="group flex flex-col items-center space-y-1">
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-red-500/20 transition-colors duration-200">
              <LogOut className="w-6 h-6 text-slate-300 group-hover:text-red-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-red-400 whitespace-nowrap">Logout</span>
          </button>
        </>
      ) : (
        <>
          <Link to="/" className="group flex flex-col items-center space-y-1" onClick={() => setOpen(false)}>
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-indigo-500/20 transition-colors duration-200">
              <Home className="w-6 h-6 text-slate-300 group-hover:text-indigo-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-indigo-400 whitespace-nowrap">Home</span>
          </Link>
          <Link to="/publish" className="group flex flex-col items-center space-y-1" onClick={() => setOpen(false)}>
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-pink-500/20 transition-colors duration-200">
              <BookOpen className="w-6 h-6 text-slate-300 group-hover:text-pink-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-pink-400 whitespace-nowrap">Publish</span>
          </Link>
          <Link to="/login" className="group flex flex-col items-center space-y-1" onClick={() => setOpen(false)}>
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-emerald-500/20 transition-colors duration-200">
              <LogIn className="w-6 h-6 text-slate-300 group-hover:text-emerald-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-emerald-400 whitespace-nowrap">Login</span>
          </Link>
          <Link to="/signup" className="group flex flex-col items-center space-y-1" onClick={() => setOpen(false)}>
            <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-purple-500/20 transition-colors duration-200">
              <UserPlus className="w-6 h-6 text-slate-300 group-hover:text-purple-400" />
            </div>
            <span className="text-xs font-medium text-slate-300 group-hover:text-purple-400 whitespace-nowrap">Sign Up</span>
          </Link>
        </>
      )}
    </>
  );

  return (
    <>
      {/* Hamburger icon for mobile overlay */}
      <button
        className="fixed top-4 left-4 z-[100] md:hidden p-2 rounded-md bg-slate-900/80 hover:bg-slate-800/90 border border-slate-700/40 shadow-lg focus:outline-none"
        aria-label="Open menu"
        onClick={() => setOpen(true)}
      >
        <Menu className="w-7 h-7 text-white" />
      </button>

      {/* Overlay menu for mobile */}
      {open && (
        <div className="fixed inset-0 z-[200] flex items-center justify-center bg-black/60 backdrop-blur-md">
          <div className="absolute top-4 right-4">
            <button
              className="p-2 rounded-full bg-slate-900/80 hover:bg-slate-800/90 border border-slate-700/40 shadow-lg"
              aria-label="Close menu"
              onClick={() => setOpen(false)}
            >
              <X className="w-7 h-7 text-white" />
            </button>
          </div>
          <nav className="flex flex-col items-center gap-8 text-center text-lg">
            {menuContent}
          </nav>
        </div>
      )}
    </>
  );
};

export default FloatingMenu;
